PRAGMA foreign_keys=OFF;
BEGIN;
PRAGMA writable_schema = on;
CREATE TABLE IF NOT EXISTS  users (
	id CHAR(32) NOT NULL, 
	email VARCHAR(255) NOT NULL, 
	full_name VARCHAR(255), 
	is_active BOOLEAN NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	updated_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE IF NOT EXISTS  exchanges (
	id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, 
	name VARCHAR(100) NOT NULL, 
	slug VARCHAR(100) NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	updated_at TIMESTAMP NOT NULL, 
	UNIQUE (name)
);
CREATE TABLE IF NOT EXISTS  sqlite_sequence(name,seq);
CREATE TABLE IF NOT EXISTS  user_exchange_accounts (
	id CHAR(32) NOT NULL, 
	user_id CHAR(32) NOT NULL, 
	exchange_id INTEGER NOT NULL, 
	label VARCHAR(100) NOT NULL, 
	api_key TEXT, 
	api_secret TEXT, 
	api_passphrase TEXT, 
	is_active BOOLEAN NOT NULL, 
	config JSON NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	updated_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_user_exchange_label UNIQUE (user_id, exchange_id, label), 
	FOREIGN KEY(user_id) REFERENCES users (id) ON DELETE CASCADE, 
	FOREIGN KEY(exchange_id) REFERENCES exchanges (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  strategies (
	id CHAR(32) NOT NULL, 
	user_id CHAR(32) NOT NULL, 
	name VARCHAR(150) NOT NULL, 
	description TEXT, 
	params JSON NOT NULL, 
	is_active BOOLEAN NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	updated_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  candles (
	id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, 
	exchange_id INTEGER NOT NULL, 
	symbol VARCHAR(50) NOT NULL, 
	timeframe VARCHAR(20) NOT NULL, 
	open_time TIMESTAMP NOT NULL, 
	close_time TIMESTAMP NOT NULL, 
	open NUMERIC(24, 10) NOT NULL, 
	high NUMERIC(24, 10) NOT NULL, 
	low NUMERIC(24, 10) NOT NULL, 
	close NUMERIC(24, 10) NOT NULL, 
	volume NUMERIC(24, 10) NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	CONSTRAINT uq_candles_exchange_symbol_timeframe_open_time UNIQUE (exchange_id, symbol, timeframe, open_time), 
	FOREIGN KEY(exchange_id) REFERENCES exchanges (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  strategy_runs (
	id CHAR(32) NOT NULL, 
	strategy_id CHAR(32) NOT NULL, 
	started_at TIMESTAMP NOT NULL, 
	finished_at TIMESTAMP, 
	status VARCHAR(50) NOT NULL, 
	metrics JSON NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(strategy_id) REFERENCES strategies (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  llm_analyses (
	id CHAR(32) NOT NULL, 
	strategy_id CHAR(32), 
	symbol VARCHAR(50), 
	summary TEXT, 
	raw_output JSON NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(strategy_id) REFERENCES strategies (id) ON DELETE SET NULL
);
CREATE TABLE IF NOT EXISTS  risk_events (
	id CHAR(32) NOT NULL, 
	user_id CHAR(32) NOT NULL, 
	strategy_id CHAR(32), 
	event_type VARCHAR(100) NOT NULL, 
	severity VARCHAR(50) NOT NULL, 
	symbol VARCHAR(50), 
	details JSON NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id) ON DELETE CASCADE, 
	FOREIGN KEY(strategy_id) REFERENCES strategies (id) ON DELETE SET NULL
);
CREATE TABLE IF NOT EXISTS  trades (
	id CHAR(32) NOT NULL, 
	user_id CHAR(32) NOT NULL, 
	account_id CHAR(32), 
	strategy_id CHAR(32), 
	strategy_run_id CHAR(32), 
	symbol VARCHAR(50) NOT NULL, 
	side VARCHAR(10) NOT NULL, 
	quantity NUMERIC(24, 10) NOT NULL, 
	price NUMERIC(24, 10) NOT NULL, 
	fee NUMERIC(24, 10), 
	executed_at TIMESTAMP NOT NULL, 
	context JSON NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id) ON DELETE CASCADE, 
	FOREIGN KEY(account_id) REFERENCES user_exchange_accounts (id) ON DELETE SET NULL, 
	FOREIGN KEY(strategy_id) REFERENCES strategies (id) ON DELETE SET NULL, 
	FOREIGN KEY(strategy_run_id) REFERENCES strategy_runs (id) ON DELETE SET NULL
);
CREATE TABLE IF NOT EXISTS  positions (
	id CHAR(32) NOT NULL, 
	user_id CHAR(32) NOT NULL, 
	account_id CHAR(32), 
	strategy_id CHAR(32), 
	trade_id CHAR(32), 
	symbol VARCHAR(50) NOT NULL, 
	size NUMERIC(24, 10) NOT NULL, 
	entry_price NUMERIC(24, 10) NOT NULL, 
	stop_loss NUMERIC(24, 10), 
	take_profit NUMERIC(24, 10), 
	is_open BOOLEAN NOT NULL, 
	opened_at TIMESTAMP NOT NULL, 
	closed_at TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id) ON DELETE CASCADE, 
	FOREIGN KEY(account_id) REFERENCES user_exchange_accounts (id) ON DELETE SET NULL, 
	FOREIGN KEY(strategy_id) REFERENCES strategies (id) ON DELETE SET NULL, 
	UNIQUE (trade_id), 
	FOREIGN KEY(trade_id) REFERENCES trades (id) ON DELETE SET NULL
);
CREATE TABLE IF NOT EXISTS  paper_accounts (
	id INTEGER NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	base_ccy VARCHAR(10) NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE IF NOT EXISTS  paper_balances (
	id INTEGER NOT NULL, 
	account_id INTEGER NOT NULL, 
	ccy VARCHAR(10) NOT NULL, 
	available NUMERIC(24, 10) NOT NULL, 
	updated_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_paper_balances_account_ccy UNIQUE (account_id, ccy), 
	FOREIGN KEY(account_id) REFERENCES paper_accounts (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  paper_positions (
	id INTEGER NOT NULL, 
	account_id INTEGER NOT NULL, 
	symbol VARCHAR(50) NOT NULL, 
	side VARCHAR(5) NOT NULL, 
	qty NUMERIC(24, 10) NOT NULL, 
	avg_entry_price NUMERIC(24, 10) NOT NULL, 
	unrealized_pnl NUMERIC(24, 10) NOT NULL, 
	updated_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_paper_positions_account_symbol UNIQUE (account_id, symbol), 
	FOREIGN KEY(account_id) REFERENCES paper_accounts (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  paper_orders (
	id INTEGER NOT NULL, 
	account_id INTEGER NOT NULL, 
	symbol VARCHAR(50) NOT NULL, 
	side VARCHAR(5) NOT NULL, 
	type VARCHAR(20) NOT NULL, 
	status VARCHAR(20) NOT NULL, 
	requested_qty NUMERIC(24, 10) NOT NULL, 
	filled_qty NUMERIC(24, 10) NOT NULL, 
	avg_fill_price NUMERIC(24, 10), 
	fee_paid NUMERIC(24, 10), 
	created_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(account_id) REFERENCES paper_accounts (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  paper_trades (
	id INTEGER NOT NULL, 
	account_id INTEGER NOT NULL, 
	symbol VARCHAR(50) NOT NULL, 
	side VARCHAR(5) NOT NULL, 
	qty NUMERIC(24, 10) NOT NULL, 
	price NUMERIC(24, 10) NOT NULL, 
	fee NUMERIC(24, 10), 
	realized_pnl NUMERIC(24, 10), 
	created_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(account_id) REFERENCES paper_accounts (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  equity_snapshots (
	id INTEGER NOT NULL, 
	account_id INTEGER NOT NULL, 
	equity NUMERIC(24, 10) NOT NULL, 
	balance NUMERIC(24, 10) NOT NULL, 
	unrealized_pnl NUMERIC(24, 10) NOT NULL, 
	created_at TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(account_id) REFERENCES paper_accounts (id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS  alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX ix_users_email ON users (email);
CREATE UNIQUE INDEX ix_exchanges_slug ON exchanges (slug);
CREATE INDEX ix_user_exchange_accounts_user_id ON user_exchange_accounts (user_id);
CREATE INDEX ix_strategies_user_id ON strategies (user_id);
CREATE INDEX ix_candles_exchange_symbol_timeframe_open_time ON candles (exchange_id, symbol, timeframe, open_time);
CREATE INDEX ix_strategy_runs_strategy_id_started_at ON strategy_runs (strategy_id, started_at);
CREATE INDEX ix_llm_analyses_strategy_id ON llm_analyses (strategy_id);
CREATE INDEX ix_llm_analyses_symbol ON llm_analyses (symbol);
CREATE INDEX ix_risk_events_symbol ON risk_events (symbol);
CREATE INDEX ix_risk_events_strategy_id ON risk_events (strategy_id);
CREATE INDEX ix_risk_events_user_id ON risk_events (user_id);
CREATE INDEX ix_trades_user_id ON trades (user_id);
CREATE INDEX ix_trades_symbol ON trades (symbol);
CREATE INDEX ix_trades_executed_at ON trades (executed_at);
CREATE INDEX ix_trades_symbol_executed_at ON trades (symbol, executed_at);
CREATE INDEX ix_trades_strategy_id ON trades (strategy_id);
CREATE INDEX ix_positions_user_id ON positions (user_id);
CREATE INDEX ix_positions_symbol ON positions (symbol);
CREATE INDEX ix_paper_balances_account_id ON paper_balances (account_id);
CREATE INDEX ix_paper_positions_account_id ON paper_positions (account_id);
CREATE INDEX ix_paper_positions_symbol ON paper_positions (symbol);
CREATE INDEX ix_paper_orders_symbol_created_at ON paper_orders (symbol, created_at);
CREATE INDEX ix_paper_orders_account_id ON paper_orders (account_id);
CREATE INDEX ix_paper_trades_symbol_created_at ON paper_trades (symbol, created_at);
CREATE INDEX ix_paper_trades_account_id ON paper_trades (account_id);
CREATE INDEX ix_equity_snapshots_account_id_created_at ON equity_snapshots (account_id, created_at);
PRAGMA writable_schema = off;
COMMIT;
